import React, {Component} from 'react';
import TodoList from '../todo-list/todo-list';

const ligbox = <span>Login please</span>;
const login = false;

const SearchPanel = () => {
    const searchStyle = {
      fontSize: '25px'
    };
    return (
      <input style = {searchStyle} placeholder = "search" />
    );
  }
  const Hed = () => {
    return (
      <h1>My to do List</h1>
    );
  };
export default class App extends Component{
    state = {
        todoData : [
      { label: 'Drink coffee', important: false, id : 1},
      { label: 'Write code', important: true, id : 2},
      { label: 'Sleep', important: false, id :3}
        ]
    };
    render(){
    return (
      <div>
        {login ? null : ligbox }
        <Hed />
        <SearchPanel />
        <TodoList todos = {this.todoData} onDeleted={(id)=>console.log('del:',id)}/>
      </div>
    );
    }
  };
